#include <stdio.h>

int isAnagram(char * s, char * t){
    int y, i = y = 0;
    int cdstIds[26];
    int ids[26];
    int strings[2][26];
    
    for (i = 0; i < 26; i++){
        strings[0][i] = 0;
        strings[1][i] = 0;
        ids[i] = 0;
        cdstIds[i] = 0;
    }
    
    do
    {
        ++strings[0][*s - 'a'];
        ++strings[1][*t - 'a'];
        if(!cdstIds[*s - 'a']){
            ids[y++] = *s - 'a';
            ++cdstIds[*s - 'a'];
        }  
    } while (*++s, *++t && *t);
	
	printf ("%d %d\n",strings[0][ids[1]], strings[1][ids[1]]);
	printf ("%d\n", y);
    if (*s || *t) { return 0; }
    
    i = 0;
    do
    {
        printf ("%d %d\n",strings[0][ids[i]], strings[1][ids[i]]);
        if (strings[0][ids[i]] != strings[1][ids[i]]) return 0;
        i++;
    }while (i < y);
    printf ("%d\n", i);
    return 1;
}

int main ()
{
	char * a = "";
	char * b = "";
	printf ("\n%d ",isAnagram(a, b));
}
